import React from 'react';
import {NavLink} from "react-router-dom";
// import styles from './HeaderNav.module.scss'
import styled from 'styled-components'
const List = styled.li`
  
`
const ListItem = styled.li`
  list-style: none;
  display: inline-block;
  margin-right: 50px;
  max-width: 120px;
  color: white;
  &Link {
    text-decoration: none;
    &Active {
      font-weight: 700;
      background-color: #2D5283;
    }
  };

`


const HeaderNav = () => (
    <nav>
    <List>
        <ListItem><NavLink exact activeClassName={styles.navItemLinkActive}
                           className={styles.navItemLink} to="/">start</NavLink> </ListItem>
        <ListItem><NavLink activeClassName={styles.navItemLinkActive}
                           className={styles.navItemLink} to="/edit">edytuj</NavLink> </ListItem>
        <ListItem><NavLink activeClassName={styles.navItemLinkActive}
                           className={styles.navItemLink} to="/add">dodaj</NavLink> </ListItem>
        <ListItem><NavLink activeClassName={styles.navItemLinkActive}
                           className={styles.navItemLink} to="/list">lista</NavLink> </ListItem>
        <ListItem><NavLink activeClassName={styles.navItemLinkActive}
                           className={styles.navItemLink} to="/settings">ustawienia</NavLink> </ListItem>
    </List>
    </nav>
);

export default HeaderNav;
